import React from 'react';
import App from './App';
import { createRoot } from 'react-dom/client';
const root = createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const handleEventSubmit = (event) => {
  console.log('Event submitted:', event);
  addEvent(event);
  setShowEventForm(false);
};
